import './App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Form from './Components/signup';
import Login from "./Components/login"; 


function App() {


  return (
  <div>
    <Router>
    <Form />
      <Switch>
      <Route exact path="/" component={Form} /> 
      <Route path="/login" component={Login} /> 
      </Switch>
    </Router>

  </div>
  );
}



export default App;
